import "core-js/modules/es.array.push.js";
import LogoIcon from "../Components/LogoIcon.vue";
export default {
  data() {
    return {
      isCalling: false
    };
  },
  components: {
    LogoIcon
  },
  methods: {
    acceptCall() {
      this.isCalling = true;
      setTimeout(() => {
        this.$store.dispatch("phone/acceptTaxiCall");
        this.$router.push("/Phone/TaxiApp/main");
      }, 2000);
    },
    declineCall() {
      this.$store.dispatch("phone/declineTaxiCall");
      this.$router.push("/Phone/TaxiApp/wait");
    },
    onBack() {
      this.$router.go(-1);
    },
    putRoute() {
      this.$callClient("W:Phone:Taxi:PutTaxiRoute");
    }
  }
};
